import style from "./footerFromZesty.module.css";

function FooterFromZesty(response) {
  return (
    <div>
      <br />
      <div>Footer From Zesty</div>
      <br />
      {response.htmlCode}
    </div>
  );
}

export async function getStaticProps() {
  // Call an external API endpoint to get posts
  const res = await fetch("https://2bxd69w7-dev.preview.zesty.io/-/custom/users.json");
  const response = await res.json();

  // By returning { props: posts }, the Blog component
  // will receive `posts` as a prop at build time
  return {
    props: {
      response,
    },
  };
}

export default FooterFromZesty;
